1	2024-05-06 18:42:08.830662+02	{"pk": 3, "live": true, "path": "00010001", "slug": "home", "depth": 2, "owner": null, "title": "Home", "locale": 1, "locked": false, "expired": false, "alias_of": null, "numchild": 0, "services": "[{\\"type\\": \\"service\\", \\"value\\": {\\"icon\\": \\"language\\", \\"title\\": \\"Web Development\\", \\"subtitle\\": \\"<p data-block-key=\\\\\\"fazw0\\\\\\">A professional website is crucial for any business or organization to establish an online presence, showcase products or services, and connect with customers.<br/>Our web development services include designing, building, and deploying responsive,<br/>user-friendly, and scalable websites using cutting-edge technologies like Wordpress,<br/>HTML, CSS, JavaScript, Python and frameworks like Django and Vue.</p>\\"}, \\"id\\": \\"1de99c39-3436-44b1-8223-15b5fc622e24\\"}, {\\"type\\": \\"service\\", \\"value\\": {\\"icon\\": \\"smartphone\\", \\"title\\": \\"Mobile App Development\\", \\"subtitle\\": \\"<p data-block-key=\\\\\\"fazw0\\\\\\">With the majority of users accessing websites and services through mobile devices,<br/>having a mobile app is essential to stay competitive and provide a seamless user experience. Our mobile app development services include designing, building, and deploying native and cross-platform mobile apps for Android and iOS devices using technologies like Android Studio, Rest APIs, and frameworks like Ionic and Capacitor.</p>\\"}, \\"id\\": \\"976dfe44-5f7f-4591-8ea8-2a30370fe14e\\"}, {\\"type\\": \\"service\\", \\"value\\": {\\"icon\\": \\"desktop_windows\\", \\"title\\": \\"Desktop App Development\\", \\"subtitle\\": \\"<p data-block-key=\\\\\\"fazw0\\\\\\">Desktop applications provide a rich and immersive user experience, and are essential for businesses and organizations that require powerful and efficient software solutions that can also work offline. Our desktop app development services include designing, building, and deploying desktop applications for Windows, macOS, and Linux using technologies like Electron, .NET, and JavaScript.</p>\\"}, \\"id\\": \\"1af82d77-a0e2-475e-a379-587f041c0b30\\"}, {\\"type\\": \\"service\\", \\"value\\": {\\"icon\\": \\"analytics\\", \\"title\\": \\"Data Analysis\\", \\"subtitle\\": \\"<p data-block-key=\\\\\\"fazw0\\\\\\">Data analysis is crucial for businesses and organizations to make informed decisions, identify trends, and optimize operations. Our data analysis services include data collection, processing, visualization, and interpretation using our inhouse tools and programming languages like Python, R, and SQL.</p>\\"}, \\"id\\": \\"1d0c363f-9a22-4b90-ab98-38c6969ed98f\\"}, {\\"type\\": \\"service\\", \\"value\\": {\\"icon\\": \\"psychology\\", \\"title\\": \\"Machine Learning\\", \\"subtitle\\": \\"<p data-block-key=\\\\\\"fazw0\\\\\\">Machine learning is a powerful technology that enables businesses and organizations to automate processes, make predictions, and improve decision-making. Our machine learning services include building, training, and deploying machine learning models using popular frameworks like TensorFlow, PyTorch, and scikit-learn, and programming languages like Python and R.</p>\\"}, \\"id\\": \\"b014e4e5-2f25-4538-a8e6-5c1c4d56d78a\\"}, {\\"type\\": \\"service\\", \\"value\\": {\\"icon\\": \\"travel_explore\\", \\"title\\": \\"Web Scraping\\", \\"subtitle\\": \\"<p data-block-key=\\\\\\"fazw0\\\\\\">Web scraping is essential for businesses and organizations to extract data from websites, monitor competitors, and gather market intelligence. Our web scraping services include building and deploying web scrapers using technologies like Python, JavaScript, and frameworks like Scrapy and Beautiful Soup, to extract data from websites and store it in a structured format.</p>\\"}, \\"id\\": \\"a847f7a0-09fe-4d04-984f-4d7f5d658e6e\\"}]", "url_path": "/home/", "expire_at": null, "locked_at": null, "locked_by": null, "seo_title": "", "go_live_at": null, "hero_image": 3, "hero_title": "Data Centric Software Solutions", "draft_title": "Home", "content_type": 2, "hero_subtitle": "<p data-block-key=\\"txrut\\">Our expertise spans Data Analytics, Machine Learning, Web Scraping, Web Development, Mobile App Development and Desktop App Development, With a focus on excellence, we bring your data to life, helping you make informed decisions. Let’s turn your data into a valuable asset for your business</p>", "live_revision": null, "show_in_menus": false, "services_title": "Services", "latest_revision": null, "translation_key": "041399dc-cd54-44d0-ad07-976e95c39bc1", "last_published_at": null, "first_published_at": null, "landing_page_image": 4, "landing_page_title": "Landing Page", "search_description": "", "hero_flat_button_url": "#landing-page", "hero_flat_button_title": "Get your business online today", "landing_page_box_title": "Get Your Business Online Today!", "wagtail_admin_comments": [], "has_unpublished_changes": false, "hero_outline_button_url": "#hero", "hero_outline_button_title": "Learn More", "landing_page_box_subtitle": "<p data-block-key=\\"pmzgd\\"><b>Professional Web Design, Hosting, and Domain Registration – All for Just</b> <b><i>R1500</i></b> <b>per Year</b></p><p data-block-key=\\"2fd82\\">Unlock your digital potential with our all-inclusive web solutions. From bespoke website design tailored to your brand's essence to reliable hosting with lightning-fast speeds and top-tier security, we've got you covered. Plus, our hassle-free domain registration ensures your online identity is secure and memorable. Trust us to elevate your online presence, leaving you free to focus on what matters most – your business's success.</p>", "latest_revision_created_at": null}	\N	3	1	2	1	Home
